window.bookSummaryJSON = "<p>Directed by the skillful hand of Megan Follows (Directors Guild Award winner) and featuring the voices of Golden Globe® winner Sandra Oh, Emmy Award® Winner Catherine O’Hara, and Emmy Award® Winner Victor Garber, Anne Shirley’s (Emmy Award® winner Michela Luci) adventures come to life in a fresh adaptation of a timeless tale. Immerse yourself in the breathtaking beauty of Canada’s Prince Edward Island with the magic of an original score and immersive sound design.</p> <p>A classic listen for the whole family, <i>Anne of Green Gables</i> transcends generations and celebrates the universal journey of self-discovery and the power of imagination. Experience the charm and warmth of shared memories like never before.</p> <p>Now available in Dolby Atmos on Audible.</p>"; 
